import React from 'react';

const Header = ({ onLogout, isAuthenticated }) => {
    return (
        <header className="header">
            <div className="logo">My Website</div>
            <div className="right-side">
                {isAuthenticated ? (
                    <button className="logout-button" onClick={onLogout}>
                        Выйти
                    </button>
                ) : (
                    <>
                        <button className="register-button" onClick={() => alert('Регистрация не реализована')}>
                            Зарегистрироваться
                        </button>
                        <button className="login-button" onClick={() => alert('Войти через страницу логина')}>
                            Войти
                        </button>
                    </>
                )}
            </div>
        </header>
    );
};

export default Header;
